// src/components/Content.js
import React from 'react';

const Content = ({ activeTab }) => {
  return (
    <div className="content">
      {activeTab === 'tab1' && <p>Games</p>}
      {activeTab === 'tab2' && <p>Content for Tab 2</p>}
    </div>
  );
};

export default Content;
